-- ----------------------------
-- Function structure for getGroupChildList
-- ----------------------------
DROP FUNCTION IF EXISTS `getGroupChildList`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getGroupChildList`(gid INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempChd VARCHAR(1000);

    SET sTemp = '$';
    SET sTempChd =cast(gid as CHAR);

    WHILE sTempChd is not null DO
        SET sTemp = concat(sTemp,',',sTempChd);

        SELECT group_concat(id) INTO sTempChd FROM   t_admingroup  where FIND_IN_SET(parentid,sTempChd)>0;
    END WHILE;
    RETURN sTemp; 
END
;;
DELIMITER ;
