INSERT INTO `t_template_flow` VALUES ('3', 'lc1020', '<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:1000px;\" width=\"841\">\r\n	<colgroup>\r\n		<col />\r\n		<col />\r\n		<col />\r\n		<col />\r\n	</colgroup>\r\n	<thead>\r\n		<tr height=\"38\">\r\n			<th colspan=\"4\" height=\"38\" scope=\"col\" style=\"height: 38px; width: 841px; text-align: center;\"><span style=\"font-weight: 400;\">横琴通号2019年度 &nbsp;&nbsp;4 月&nbsp;&nbsp; 培训需求表</span></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr height=\"18\">\r\n			<td colspan=\"3\" height=\"18\" style=\"height: 18px; text-align: center;\">　</td>\r\n			<td>提报日期：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;月&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;日</td>\r\n		</tr>\r\n		<tr height=\"35\">\r\n			<td height=\"35\" style=\"height: 35px; text-align: center;background-color: rgb(135, 206, 235);\">序号</td>\r\n			<td style=\"text-align: center;background-color: rgb(135, 206, 235);\">部门</td>\r\n			<td style=\"text-align: center;background-color: rgb(135, 206, 235);\">培训需求内容</td>\r\n			<td style=\"text-align: center;background-color: rgb(135, 206, 235);\">备注</td>\r\n		</tr>\r\n		<tr height=\"40\">\r\n			<td height=\"40\" style=\"height: 40px; text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"40\">\r\n			<td height=\"40\" style=\"height: 40px; text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"40\">\r\n			<td height=\"40\" style=\"height: 40px; text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"40\" style=\"height: 40px; text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n			<td style=\"text-align: center;\">&nbsp;</td>\r\n		</tr>\r\n		<tr height=\"40\">\r\n			<td colspan=\"4\"><span style=\"font-size:10px;\">备注：培训需求每月提报两次，提交时间为：每月月初的培训需求于上月末最后一天提交，每月下半月的培训需求于当月15日提交；经部门负责人审核后，发送给运营中心培训经理，同时抄送至运营中心负责人。若未按时间点收到各部门提报表单，视为暂无培训需求。</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '2019-06-11 14:07:47', '2019-06-11 14:40:33', '1', '3', '培训需求表');
